import { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import {
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  Typography,
  Grid,
  Card,
  CardContent,
  Box,
} from "@mui/material";

export default function AccountsList() {
  const [accounts, setAccounts] = useState([]);
  const navigate = useNavigate();

  useEffect(() => {
    fetch("http://localhost:8000/accounts")
      .then((res) => res.json())
      .then(setAccounts)
      .catch((err) => console.error("Failed to fetch accounts:", err));
  }, []);

  // Calculate totals
  const totalAccounts = accounts.length;
  const totalQuotedCost = accounts.reduce(
    (sum, acc) => sum + (parseFloat(acc.quoted_cost) || 0),
    0
  );

  return (
    <>
      <Typography variant="h4" gutterBottom>
        AWS Cost Dashboard - Accounts Overview
      </Typography>

      {/* Two summary cards in one row */}
      <Grid container spacing={3} sx={{ mb: 5 }}>
        {/* Card 1: Total Accounts */}
        <Grid item xs={12} sm={6} md={6}>
          <Card elevation={3} sx={{ height: "100%", bgcolor: "#e3f2fd" }}>
            <CardContent sx={{ textAlign: "center" }}>
              <Typography variant="subtitle2" color="text.secondary" gutterBottom>
                Total Accounts
              </Typography>
              <Typography variant="h4" fontWeight="bold" color="primary.main">
                {totalAccounts}
              </Typography>
            </CardContent>
          </Card>
        </Grid>

        {/* Card 2: Total Quoted Cost */}
        <Grid item xs={12} sm={6} md={6}>
          <Card elevation={3} sx={{ height: "100%", bgcolor: "#e8f5e9" }}>
            <CardContent sx={{ textAlign: "center" }}>
              <Typography variant="subtitle2" color="text.secondary" gutterBottom>
                Total Quoted Cost
              </Typography>
              <Typography variant="h4" fontWeight="bold" color="success.dark">
                ${totalQuotedCost.toFixed(2)}
              </Typography>
            </CardContent>
          </Card>
        </Grid>
      </Grid>

      {/* Accounts Table */}
      <Typography variant="h5" gutterBottom sx={{ mb: 2 }}>
        All Accounts
      </Typography>

      <TableContainer component={Paper} elevation={2}>
        <Table>
          <TableHead>
            <TableRow sx={{ bgcolor: "#f5f5f5" }}>
              <TableCell>
                <strong>Account Name</strong>
              </TableCell>
              <TableCell>
                <strong>Quoted Cost</strong>
              </TableCell>
              <TableCell>
                <strong>Onboard Date</strong>
              </TableCell>
            </TableRow>
          </TableHead>

          <TableBody>
            {accounts.length === 0 ? (
              <TableRow>
                <TableCell colSpan={3} align="center" sx={{ py: 4 }}>
                  <Typography color="text.secondary">No accounts found</Typography>
                </TableCell>
              </TableRow>
            ) : (
              accounts.map((acc) => (
                <TableRow
                  key={acc.account_id}
                  hover
                  sx={{ cursor: "pointer" }}
                  onClick={() => navigate(`/accounts/${acc.account_id}`)}
                >
                  <TableCell>{acc.name}</TableCell>
                  <TableCell>${parseFloat(acc.quoted_cost || 0).toFixed(2)}</TableCell>
                  <TableCell>{acc.onboard_date}</TableCell>
                </TableRow>
              ))
            )}
          </TableBody>
        </Table>
      </TableContainer>
    </>
  );
}
